import React, {Component} from 'react';
import {Form, Modal, Button} from 'react-bootstrap';

class SearchForm extends Component {
    render(){
        return this.props.postEditing ? (
            <Modal 
              style={{zIndex: '9'}}
              title="Post"
              acceptEnabled={true}
              isLoading={false}>
              <Modal.Header closeButton>
                <Modal.Title>Post</Modal.Title>
                </Modal.Header>
              <Modal.Body>
              <Form onSubmit={this.props.acceptReviewHandler}>
                <Form.Group controlId="lat">
                    <Form.Label>Latitude</Form.Label>
                    <Form.Control type="text" placeholder="Latitude"/>
                </Form.Group>
                <Form.Group controlId="lng">
                    <Form.Label>Longitude</Form.Label>
                    <Form.Control type="text" placeholder="Longitude"/>
                </Form.Group>
                <Button type="submit">Post</Button>
            </Form>
            </Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={this.props.cancelReviewHandler}>Close</Button>
            </Modal.Footer>
            </Modal>) : null
    };
}

export default SearchForm;
